export default {
  name: 'RenProcessMultiple',
  data: function data() {
    return {
      // 是否显示启动流程
      startProcessVisible: false,
      // 是否任务处理
      runningHandleVisible: false,
      // 是否显示流程处理详情
      processDetailVisible: false,
      // 用于区分流程启动（start）、任务处理(taskHandle)以及查看详情(null)
      showType: null,
      // 父级对象
      parentObj: null,
      dataForm: {
        processDefinitionKey: '',
        taskId: '',
        businessKey: '',
        processInstanceId: ''
      },
      // 回调函数
      callbacks: {
        // 启动成功回调
        startProcessSuccessCallback: null,
        // 启动失败回调
        startProcessErrorCallback: null,
        // 任务处理成功回调
        taskHandleSuccessCallback: null,
        // 任务处理失败回调
        taskHandleErrorCallback: null,
        // 表单保存成功回调
        formSaveSuccessCallback: null,
        // 表单保存失败回调
        formSaveErrorCallback: null
      }
    };
  },
  components: {},
  created: function created() {
    var _this = this;

    this.$nextTick(function () {
      if (!_this.showType) {
        _this.startProcessVisible = false;
        _this.runningHandleVisible = false;
        _this.processDetailVisible = true;
      } else if (_this.showType === 'start') {
        // 启动流程
        _this.startProcessVisible = true;

        _this.$nextTick(function () {
          _this.$refs.renProcessStart.rootObj = _this.parentObj;
          _this.$refs.renProcessStart.callbacks = _this.callbacks;
          _this.$refs.renProcessStart.dataForm.processDefinitionKey = _this.dataForm.processDefinitionKey;
        });
      } else if (_this.showType === 'taskHandle') {
        // 任务处理
        _this.runningHandleVisible = true;

        _this.$nextTick(function () {
          _this.$refs.renProcessRunning.rootObj = _this.parentObj;
          _this.$refs.renProcessRunning.dataForm.taskId = _this.dataForm.taskId;
          _this.$refs.renProcessRunning.dataForm.processInstanceId = _this.dataForm.processInstanceId;
          _this.$refs.renProcessRunning.callbacks = _this.callbacks;
          _this.$refs.renProcessRunning.dataForm.businessKey = _this.dataForm.businessKey;
          _this.$refs.renProcessRunning.dataForm.processDefinitionKey = _this.dataForm.processDefinitionKey;
        });
      }
    });
  },
  props: {
    saveFormUrl: String,
    updateInstanceIdUrl: String,
    dataFormName: String
  },
  watch: {},
  methods: {}
};
